@Component({
  selector: 'app-perfil',
  templateUrl: './perfil.component.html',
  styleUrls: ['./perfil.component.css']
})
export class PerfilComponent {

}
<div class="container">
  <h2>Mi Perfil</h2>
  <div *ngIf="usuario">
    <p>Nombre: {{ usuario.nombre }}</p>
    <p>Sexo: {{ usuario.sexo }}</p>
  </div>
</div>
